import TextEditor from "./TextEditor"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom"
import { v4 as uuidv4 } from 'uuid';

const redirectUrl = `/documents/${uuidv4()}`;

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <Redirect to={redirectUrl} />        
        </Route>
        <Route path="/documents/:id">
          <TextEditor />
        </Route>
      </Switch>
    </Router>
  )
}
export default App
